async function getTeamRanks(){document.getElementById("viewScoutsButton").innerHTML="Requesting Data...";let e=new XMLHttpRequest;e.open("GET","/api/scouts/me/profile",!0),e.withCredentials=!0,e.onreadystatechange=async()=>{if(e.readyState===XMLHttpRequest.DONE&&200===e.status){let t=JSON.parse(e.responseText);console.log(t)}else 401===e.status||403===e.status?window.location.href="/login":400===e.status?document.getElementById("viewScoutsButton").innerHTML="bad request":500===e.status?document.getElementById("viewScoutsButton").innerHTML="internal server error":document.getElementById("viewScoutsButton").innerHTML="downloading data..."},e.send()}